import React from 'react'

const AverageTop30Contacted = ({ avgTop30Contacted }) => {

    return (
        <div>
            <center><h1>Average top 30 contacted</h1></center>
            <div className="card">
                <div>
                    <p className="card-text">{avgTop30Contacted}</p>
                </div>
            </div>

        </div>
    )
};

export default AverageTop30Contacted
